// src/pages/Portfolio.jsx
import React, { useState } from 'react';
import styled from 'styled-components';
import { FaCode, FaCertificate, FaTools } from 'react-icons/fa';

const PortfolioContainer = styled.div`
  padding: 2rem;
  background-color: #0a0a0f;
  min-height: 100vh;
  color: white;
`;

const Header = styled.div`
  text-align: center;
  margin-bottom: 3rem;

  h1 {
    color: #e066ff;
    font-size: 2.5rem;
    margin-bottom: 0.5rem;
  }

  p {
    color: #888;
    font-size: 1rem;
    max-width: 800px;
    margin: 0 auto;
    line-height: 1.6;
  }
`;

const Navigation = styled.div`
  display: flex;
  justify-content: center;
  gap: 1rem;
  margin-bottom: 3rem;
`;

const NavButton = styled.button`
  padding: 0.8rem 1.5rem;
  border-radius: 25px;
  border: none;
  background: ${props => props.active ? 'linear-gradient(45deg, #e066ff, #9f2fff)' : 'rgba(255, 255, 255, 0.1)'};
  color: white;
  cursor: pointer;
  transition: all 0.3s ease;
  display: flex;
  align-items: center;
  gap: 0.5rem;

  &:hover {
    transform: translateY(-2px);
    box-shadow: 0 5px 15px rgba(224, 102, 255, 0.3);
  }
`;

const ProjectsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: 2rem;
  padding: 1rem;
  max-width: 1200px;
  margin: 0 auto;
`;

const ProjectCard = styled.div`
  background: rgba(255, 255, 255, 0.05);
  border-radius: 15px;
  overflow: hidden;
  transition: transform 0.3s ease;

  &:hover {
    transform: translateY(-5px);
  }

  img {
    width: 100%;
    height: 200px;
    object-fit: cover;
  }

  .content {
    padding: 1.5rem;

    h3 {
      color: #e066ff;
      margin-bottom: 0.5rem;
    }

    p {
      color: #888;
      font-size: 0.9rem;
      line-height: 1.6;
    }
  }
`;

const Portfolio = () => {
  const [activeTab, setActiveTab] = useState('projects');

  const projects = [
    {
      id: 1,
      title: 'Aritmatiko Solver',
      description: 'A sophisticated mathematical problem-solving application with advanced algorithms and intuitive interface.',
      image: '/images/aritmatiko.png'
    },
    {
      id: 2,
      title: 'Auto-Chat-Discord',
      description: 'An intelligent Discord bot featuring automated responses and community management capabilities.',
      image: '/images/discord-bot.png'
    },
    {
      id: 3,
      title: 'Portfolio Website',
      description: 'A modern, responsive portfolio website built with React and styled-components.',
      image: '/images/portfolio.png'
    }
  ];

  const certificates = [
    { title: 'AWS Certified', description: 'Cloud fluency and foundational AWS knowledge.' },
    { title: 'Google ML Crash Course', description: 'Intro to machine learning using Google tools.' },
  ];

  const skills = ['React.js', 'Node.js', 'Tailwind CSS', 'MongoDB', 'Machine Learning'];

  return (
    <PortfolioContainer>
      <Header>
        <h1>Portfolio Showcase</h1>
        <p>Explore My Journey Through Projects, Certificates, And Technical Expertise. Each Section Represents a Milestone in My Continuous Learning Path</p>
      </Header>

      <Navigation>
        <NavButton 
          active={activeTab === 'projects'} 
          onClick={() => setActiveTab('projects')}
        >
          ðŸš€ Projects
        </NavButton>
        <NavButton 
          active={activeTab === 'certificates'} 
          onClick={() => setActiveTab('certificates')}
        >
          ðŸ“œ Certificates
        </NavButton>
        <NavButton 
          active={activeTab === 'skills'} 
          onClick={() => setActiveTab('skills')}
        >
          ðŸ’¡ My Skills
        </NavButton>
      </Navigation>

      {activeTab === 'projects' && (
        <ProjectsGrid>
          {projects.map(project => (
            <ProjectCard key={project.id}>
              <img src={project.image} alt={project.title} />
              <div className="content">
                <h3>{project.title}</h3>
                <p>{project.description}</p>
              </div>
            </ProjectCard>
          ))}
        </ProjectsGrid>
      )}

      {activeTab === 'certificates' &&
        certificates.map((cert, i) => (
          <div key={i} className="bg-[#1c1b2e] p-5 rounded-lg shadow-md">
            <h3 className="text-xl font-bold mb-2">{cert.title}</h3>
            <p className="text-gray-300">{cert.description}</p>
          </div>
        ))}

      {activeTab === 'skills' && (
        <div className="col-span-full text-center">
          <ul className="flex flex-wrap justify-center gap-4 mt-4">
            {skills.map((skill, i) => (
              <li key={i} className="bg-pink-600 text-white px-4 py-2 rounded-full shadow-sm">
                {skill}
              </li>
            ))}
          </ul>
        </div>
      )}
    </PortfolioContainer>
  );
};

export default Portfolio;
